const TitleBar = () => {
    return (
      <div className="calculator__titlebar">
        <div className="titlebar__container">
          <button className="titlebar-buttons titlebar-red-button"></button>
          <button className="titlebar-buttons titlebar-yellow-button"></button>
          <button className="titlebar-buttons titlebar-green-button"></button>
        </div>
      </div>
    );
  };

  export default TitleBar;
